import React from 'react';
import PropTypes from 'prop-types';

// 로그인 페이지(로그인 세션O) -> 대시보드
const RouterGuard = ({ children }) => {
  return (
    <>
      {children}
    </>
  );
};

RouterGuard.propTypes = {
  children: PropTypes.node
};

export default RouterGuard;
